import React from 'react'
import './ListItem.css'

function ListItems(props) {
    const items = props.items;
    const ListItem = items.map(items =>
        {
            return <div className="list" key="item.key">
                <p>{items.text}</p>

            </div>
        })
    return(
        <div>{ListItem}</div>
    )
}

export default ListItem;
